import React from "react"
import './App.css';
import Page from './Page';
import IMDB_Before from './images/redesign/IMDB_now.png'

function Redesign(props) {
    return (
        <Page className="portfolio">
            <h1> IMDB Redesign</h1>
            <div className="portfolio-section1" >
                <h2>Context</h2>
                <p>The goal of this project was to take a website that is much in need of a drastic makeover. As a film fanatic, my disappointment with IMDB's drew closer to planning and implementing a makeover.</p>
            </div>

            <div className="portfolio-section2" >
                <h2>IMDB</h2>
                <p>IMDB is a website </p>
                <img src={IMDB_Before} ></img>
            </div>

        </Page>
    )
  }


export default Redesign;
